import './App.css';

function App() {
  return (
    <div class="bg-blue-500">
      <div class="h-screen flex items-center justify-center shadow-lg ">
        <div class="border border-blue-300 p-8 rounded-lg bg-blue-400 max-w-md w-full shadow-custom rounded transform scale-90 shadow-lg">
          <h1 className="text-2xl font-semibold text-white mb-6 border-gray-300 pb-4" style={{ borderBottomWidth: '2px', borderBottomStyle: 'solid' }}>
            Weather App
          </h1>
          <input type="text" placeholder="Enter City Name"
            class="border border-blue-300 px-4 py-2 font-semibold  text-xl rounded-lg w-full h-16 focus:outline-none text-center" />

          <p class=" text-center text-white text-lg m-2">or</p>
          <button type="submit"
            class="bg-blue-500 shadow-custom text-white text-xl py-2 px-4 rounded-lg w-full h-16 shadow-lg hover:scale-105 transform transition-transform duration-300 ease-in-out">
             Location Auto
            </button>
        </div>
      </div>
    </div>

  );
}

export default App;
